import './css/style.css';
import {BrowserRouter, Route, Routes} from 'react-router-dom'

let App = () => {

  let massge = ()=> {
    return "this is page not found 404" 
  }
  

  return (

<div>

     
     <BrowserRouter>
       <Navber className="text"></Navber>\
       <Content></Content>
              <Routes>
                  <Route  path='/content' element={<Content></Content>}/>
                  <Route path='/About' element={<About/>}></Route>
                  <Route path='/section' element={<Section/>}/>
                  <Route path='/sidebar' element={<Sidebar/>}/>

                  <Route path='*' element={
                       <NotFound title={massge()} color="success"> </NotFound>
                  }/>
              </Routes>
     </BrowserRouter>


</div>


  )
}



export default App
